import React, { useState, useEffect } from 'react';
import './App.css';
import { Breadcrumb, Layout, Menu } from 'antd';
import { BookOutlined } from '@ant-design/icons';
import { BrowserRouter, Routes, Route, Link, Navigate } from 'react-router-dom';

import LandingPage from './components/pages/LandningPage.jsx';
import LoginPage from './components/pages/LoginPage.jsx';
import RegisterPage from './components/pages/RegisterPage.jsx';

import UserMainPage from './components/pages/User/UserMainPage.jsx';
import UserTestPage from './components/pages/User/UserTestPage.jsx';
import UserTestResultPage from './components/pages/User/UserTestResultPage.jsx';
import UserCoursePage from './components/pages/User/UserCoursePage.jsx';
import UserTaskPage from './components/pages/User/UserTaskPage.jsx';

import AdminMainPage from './components/pages/Admin/AdminMainPage.jsx';
import AdminManageUsersPage from './components/pages/Admin/AdminManageUsersPage.jsx';
import AdminManageProfPage from './components/pages/Admin/AdminManageProfPage.jsx';
import AdminManageTestPage from './components/pages/Admin/AdminManageTestPage.jsx';

const { Header, Content, Footer } = Layout;

function Navbar({ isLoggedIn }) {
  return (
    <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']} style={{ marginLeft: 'auto' }}>
      <Menu.Item key="1">
        <Link to="/">Home</Link>
      </Menu.Item>
      {isLoggedIn && (
        <>
          <Menu.Item key="2">
            <Link to="/user_courses">My Courses</Link>
          </Menu.Item>
          <Menu.Item key="3">
            <Link to="/user_test_results">My Tests</Link>
          </Menu.Item>
        </>
      )}
      {!isLoggedIn && (
        <>
          <Menu.Item key="2">
            <Link to="/login">Login</Link>
          </Menu.Item>
          <Menu.Item key="3">
            <Link to="/register">Register</Link>
          </Menu.Item>
        </>
      )}
    </Menu>
  );
}

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Fetch login status from an authentication service (replace with your logic)
  useEffect(() => {
    const storedLoginStatus = localStorage.getItem('isLoggedIn');
    setIsLoggedIn(storedLoginStatus === 'true'); // Parse stored value
  }, []);

  const handleLogin = () => {
    setIsLoggedIn(true);
    localStorage.setItem('isLoggedIn', 'true'); // Store login status (replace with persistent storage)
  };

  const handleLogout = () => {
    setIsLoggedIn(false);
    localStorage.removeItem('isLoggedIn'); // Clear stored status
  };

  return (
    <BrowserRouter>
      <Layout style={{ minHeight: '100vh' }}>
        <Header
          style={{
            position: 'fixed',
            zIndex: 1,
            width: '100%',
            display: 'flex',
            alignItems: 'center',
          }}
        >
          <div style={{ color: 'white' }} className="demo-logo">
            <BookOutlined /> Edy AI system
          </div>
          <Navbar isLoggedIn={isLoggedIn} />
        </Header>
        <Content style={{ padding: '0 48px', marginTop: 64 }}>
          <Breadcrumb style={{ margin: '16px 0' }}>
            <Breadcrumb.Item>Home</Breadcrumb.Item>
          </Breadcrumb>
          <Routes>
            <Route path="/" element={<LandingPage />} />
            <Route path="/login" element={<LoginPage onLogin={handleLogin} />} /> {/* Pass login function */}
            <Route path="/logout" element={<Navigate to="/" replace onLogout={handleLogout} />} /> {/* Redirect on logout, pass logout function */}
            <Route path="/register" element={<RegisterPage />} />

            <Route path="/user_main" element={isLoggedIn ? <UserMainPage /> : <Navigate to="/login" replace />} /> {/* Protected route using Navigate */}

            <Route path="/user_courses" element={isLoggedIn ? <UserCoursePage /> : <Navigate to="/login" replace />} />
            <Route path="/profession_test/:id" element={isLoggedIn ? <UserTestPage /> : <Navigate to="/login" replace />} /> {/* Protected route */}
            <Route path="/user_test_results" element={isLoggedIn ? <UserTestResultPage /> : <Navigate to="/login" replace />} /> {/* Protected route */}
            <Route path="/user_tasks" element={isLoggedIn ? <UserTaskPage /> : <Navigate to="/login" replace />} /> {/* Protected route */}

            <Route path="/admin_main" element={<AdminMainPage />} /> {/* Admin route (assuming separate authorization for admins) */}
            <Route path="/admin_users" element={<AdminManageUsersPage />} /> {/* Admin route */}
            <Route path="/admin_prof" element={<AdminManageProfPage />} /> {/* Admin route */}
            <Route path="/admin_test" element={<AdminManageTestPage />} /> {/* Admin route */}
          </Routes>
        </Content>
        <Footer style={{ textAlign: 'center' }}>
          EdySystem Â©{new Date().getFullYear()} Created by KirilsK
        </Footer>
      </Layout>
    </BrowserRouter>
  );
}

export default App;
